MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "The Calibre product line includes products specifically designed to help you improve the yield of your designs.");
MGCAddSnippet(6, "Using Calibre YieldAnalyzer and Calibre YieldEnhancer can help you prevent many types of defects that are common in any design.");
MGCAddSnippet(7, "The Calibre DFM product has a minimum-level flow you can adapt to your design style.");
MGCAddSnippet(8, "When incorporating DFM products into your existing flow, you must consider what potential design problems the product can address.");
MGCAddSnippet(9, "Calibre YieldAnalyzer provides analysis tools for assessing yield, comparing designs, and prioritizing modifications.");
MGCAddSnippet(10, "Calibre YieldEnhancer performs automated design modification designed to enhance manufacturability and yield. ");
MGCAddSnippet(11, "Calibre YieldServer is a software system design specifically for managing the layout design data required with designing for improved manufacturability and yield.");
MGCAddSnippet(12, "Before running Calibre YieldAnalyzer or Calibre YieldEnhancer, you must have a full Calibre installation and the appropriate licenses.");
MGCAddSnippet(13, "If you intend to create DFM scripts using TVF, then there are certain requirements you must meet.");
MGCAddSnippet(14, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(15, "The move to Design for Manufacturability (DFM) is about developing closer associations between the design world and the manufacturing world. ");
MGCAddSnippet(16, "The Calibre YieldAnalyzer and Calibre YieldEnhancer software is executed by the Calibre engine, either flat or hierarchical, that you invoke from the command line. Running Calibre DFM from the command line is the preferred method for full chip analysis or enhancement when the layout database is supplied in OASIS or GDS format.");
MGCAddSnippet(17, "The command line invocation mode, that is using either the -drc or -dfm switch, varies depending on the way the rule file has been constructed, and your needs with respect to results interpretation. ");
MGCAddSnippet(18, "This command is used to invoke the Calibre hierarchical engine.");
MGCAddSnippet(19, "Invoking Calibre DFM from Calibre Interactive is the preferred method for partial chip analysis or enhancement, or when the layout database is supplied in a format other than OASIS or GDS.");
MGCAddSnippet(20, "The power of DFM comes largely from the ability to compare and contrast designs with respect to manufacturability concerns.");
MGCAddSnippet(21, "The Calibre DFM products require an SVRF rule file as input similar to Calibre nmDRC. There are, however, differences between a DFM and a nmDRC SVRF rule file.");
MGCAddSnippet(22, "The Calibre DFM products can output a Results Database (RDB) and a DFM database. ");
MGCAddSnippet(23, "You generate a DFM database by running calibre in DFM mode, which requires that you invoke the tool using the -dfm switch.");
MGCAddSnippet(24, "Many of the DFM operations produce results containing types of data that the standard Calibre nmDRC Results Database does not handle. ");
MGCAddSnippet(25, "The DFM SVRF rule file you input to the Calibre DFM products must define connectivity and allow for case sensitivity. Follow the additional steps required to include this information in your rule file.");
MGCAddSnippet(26, "One of the primary differences between Calibre nmDRC checks and DFM checks is that some of the DFM operations are node-aware. ");
MGCAddSnippet(27, "When writing rule files used to enhance the manufacturability of a design, you must consider the special needs of backannotation to DEF. ");
MGCAddSnippet(28, "Calibre Interactive DFM provides several methods for customizing a Calibre rule file. Some methods, like selecting checks or defining inputs and outputs for the runs, do not involve any special coding in the rule file. ");
MGCAddSnippet(29, "When your rule file contains multiple critical area and recommended rule checks, you can group related checks under a single name. ");
MGCAddSnippet(30, "By using variables in your rule file, a single rule file can perform multiple functions. ");
MGCAddSnippet(31, "SVRF provides only limited support for variables, and there are many restrictions on their use. ");
MGCAddSnippet(32, "TVF provides more robust support for environment variables, allowing you to build SVRF calls out of strings. ");
MGCAddSnippet(33, "Whether to use SVRF or TVF for the DFM rules depends on a number of issues.");
MGCAddSnippet(34, "DFM automatic waivers supports Critical Feature Analysis (CFA).");
MGCAddSnippet(35, "Some key rule writing techniques for developing DFM rule files are introduced.");
MGCAddSnippet(36, "Analyzing a design using Calibre YieldAnalyzer is a two-step process. ");
MGCAddSnippet(37, "Unlike design rule checks, which define hard and fast rules that should not be violated, recommended rule checks differ from Calibre nmDRC rules in that they define rules that can be violated, but at a cost. ");
MGCAddSnippet(38, "Use this method when you want to save the actual measurements from DFM or Calibre nmDRC checks, such as the exact width, space or common run length of a spacing error, as properties on individual geometries. ");
MGCAddSnippet(39, "Complex design rule checks identify problems caused by the interaction of multiple conditions that might otherwise be benign. ");
MGCAddSnippet(40, "After you have identified errors within your design, you can generate a score for each error to see where potential improvements are likely to be most beneficial.");
MGCAddSnippet(41, "You generate scores and metrics by analyzing the results produced by recommend rules or critical area checks. ");
MGCAddSnippet(42, "The Calibre RVE for DFM user interface is designed to display DFM check and score data in a report card format. ");
MGCAddSnippet(43, "Calibre YieldEnhancer provides operations that make automatic modifications to your design. You can learn how to use these operations to perform certain design tasks.");
MGCAddSnippet(44, "The DFM Transition operation improves transitions by doubling vias where ever possible, thereby building redundancy into the design. ");
MGCAddSnippet(45, "The DFM Expand Enclosure operation improves transitions by increasing the size of via enclosures, thereby reducing sensitivity to alignment issues.");
MGCAddSnippet(46, "Use this method when coding an SVRF rule file to expand enclosures for single vias that remain after doubling vias.");
MGCAddSnippet(47, "Verifying a DFM rule deck ensures that the correct errors are being flagged (similar to a DRC run), and that the correct scores are being calculated for the violations.");
MGCAddSnippet(48, "Calibre YieldEnhancer is a set of tools designed to improve yield.");
MGCAddSnippet(49, "You can incorporate the YieldEnhancer flow into your design flow either by running a wrapper script or by running the six stages of the wrapper script independently.");
MGCAddSnippet(50, "The first stage involves setting up your environment, preparing a rule file, and creating a layermap file prior to using Calibre YieldEnhancer to insert redundant vias and expand via enclosures.");
MGCAddSnippet(51, "If you are using an input database in the LEF/DEF or OPENACCESS formats, you must set a few environment variables to prepare YieldEnhancer to read your database. ");
MGCAddSnippet(52, "You must make modifications to your SVRF rule file to specify via insertion and expand via enclosure operations.");
MGCAddSnippet(53, "If your input database format is LEF/DEF, you must provide a layermap file. ");
MGCAddSnippet(54, "Stage 2 involves performing layout enhancement by running Calibre in -dfm mode with a Calibre YieldEnhancer rule file.");
MGCAddSnippet(55, "Stage 3 backannotates the added redundant vias and modifies via enclosures into the original database to create an enhanced database.");
MGCAddSnippet(56, "Stage 4 defines the inputs for adding metal fill.");
MGCAddSnippet(57, "Stage 5 adds metal fill by running Calibre in -dfm mode with a Calibre YieldEnhancer rule file.");
MGCAddSnippet(58, "Stage 6 backannotates the added redundant vias and modifies via enclosures into the original database to create an enhanced database.");
MGCAddSnippet(59, "If desired, you can run multiple stages of the YieldEnhancer flow by using a wrapper script. ");
MGCAddSnippet(60, "Critical Area Analysis allows you to identify those areas on a chip that are most sensitive to failures caused by random particles. ");
MGCAddSnippet(61, "Calibre YieldAnalyzer Critical Area Analysis (CAA) evaluates the interactions between actual layout data and a set of defect particle models to extract all possible locations where electrical short or open conditions could occur on the chip.");
MGCAddSnippet(62, "In general, the CAA flow with Calibre YieldAnalyzer consists of a basic flow with corresponding choices. ");
MGCAddSnippet(63, "Typically, defect density files are supplied by your foundry in encrypted form. ");
MGCAddSnippet(64, "You can use Calibre Interactive - DFM to generate a CAA rule file and perform critical area analysis. ");
MGCAddSnippet(65, "Calibre provides several options for reviewing critical area analysis results. ");
MGCAddSnippet(66, "If your layout database contains marker layers embedded in different IP types, then these marker layers can be specified for special handling during CAA. ");
MGCAddSnippet(67, "If your layout database contains exclusion layers embedded in different IP types, then specify the exclusion layers for special handling during CAA. ");
MGCAddSnippet(68, "If your design contains embedded SRAMs with repair resources consisting of redundant rows or columns, then you can calculate the effect of memory redundancy on Defect-Limited Yield (DLY). ");
MGCAddSnippet(69, "This procedure demonstrates running CAA memory analysis with Calibre YieldAnalyzer CAA.");
MGCAddSnippet(70, "CAA features in Calibre RVE for DFM enable you to generate by-window colormaps. ");
MGCAddSnippet(71, "Calibre RVE for DFM and Calibre DFM batch reporting support re-analysis for memory analysis results.");
MGCAddSnippet(72, "You can perform a critical area analysis restricted to a specified list of critical nets.");
MGCAddSnippet(73, "Within Calibre Interactive DFM, you can use the CAA library flow to quickly analyze a library of cells. ");
MGCAddSnippet(74, "To use the library flow, you must specify a layer that defines the cells  placement boundaries in a similar way as a boundary used for a place and route run. ");
MGCAddSnippet(75, "The CAA What-if Analysis tool provides you with the ability see the effects of changes to a layer and defect type, or a new die size.");
MGCAddSnippet(76, "The Calibre YieldAnalyzer CAA No Defect Density (CAA NDD) flow acts as an automated DFM scoring tool that uses the Avg_Quality metric for scoring layers and rules. When you use the CAA NDD flow (supported for Calibre CAA tool versions 2017.2 and later), there is no need to provide foundry defect density data (D0). The standard analysis methods still apply (Chip, Cell, Window).");
MGCAddSnippet(77, "The CAA NDD flow allows you to run Calibre CAA as a DFM scoring tool using the standard CAA flow without the requirement of providing foundry defect density data or rule deck development.");
MGCAddSnippet(78, "The CAA NDD flow uses an Avg_Quality metric that is a normalized value for a DFM score. This metric is suitable for design screening of chip and IP designs for DFM compliance that is consistent with quality and reliability initiatives.");
MGCAddSnippet(79, "You run a CAA NDD analysis from the Calibre Interactive DFM GUI or batch mode similar to a standard CAA run with the added advantage that defect density data is not required or used. The output from a CAA NDD run is a DFM score instead of a yield metric.");
MGCAddSnippet(80, "You use the standard Calibre CAA options to review CAA NDD score metric results. The CAA NDD results are DFM scores instead of the yield results generated in a standard CAA run.");
MGCAddSnippet(81, "Calibre DFM Explorer provides an interface for running several analysis tools in a simple flow.");
MGCAddSnippet(82, "DFM Explorer (DE) provides a common cockpit for running several analysis tools.");
MGCAddSnippet(83, "The process design kit (PDK) for DFM Explorer must be provided by the foundry. It must have a common directory structure for all tools in the flow (LFD, MAS, VRC, and PM). This ensures that technology information is properly found and loaded during a DE run.");
MGCAddSnippet(84, "The DFM Explorer GUI presents several tabs, one for each of the analysis tools and others for setting up and reviewing run information. The behavior of each tab is similar, with a few exceptions.");
MGCAddSnippet(85, "You can start DFM Explorer with or without a runset file. ");
MGCAddSnippet(86, "The DFM Spec Fill Optimizer, DFM Spec Fill Shape, DFM Spec Fill, and DFM Fill rule file elements are used in modern fill solutions. These elements comprise the Calibre SmartFill solution.");
MGCAddSnippet(87, "Adding fill to your layout using Calibre SmartFill begins with a DRC-clean layout and ends with a DRC-clean layout with fill. ");
MGCAddSnippet(88, "DFM Fill Spec and DFM Fill Spec Shape statements can have a significant impact on both the effectiveness of the fill solution and the run-time performance of the Calibre SmartFill toolset. Certain practices can provide better results.");
MGCAddSnippet(89, "In some cases the density of certain regions in a design already meets the density requirement when measured in large window, and as a result, no fill is added to such windows. This can cause areas with no fill, which should be avoided. There are two methods for preventing empty fill areas.");
MGCAddSnippet(90, "The fill pattern is determined by the STEP and OFFSET keywords in DFM Spec Fill or DFM Spec Fill Shape. A simple rectangular array uses the STEP keyword only. A staggered array is defined with both the STEP and OFFSET keywords. ");
MGCAddSnippet(91, "Fill shapes can have as many vertices as needed. Shapes that are not rectangular are complex.");
MGCAddSnippet(92, "When changes are made to the design through an engineering change order (ECO) it is preferable to maintain the existing fill design and implement changes only to the affected layout design areas. This is because reapplying fill to the entire layout design involves long run times and possible changes to the entire fill design. Making changes to the fill only in the regions surrounding the ECO area minimizes these impacts.");
MGCAddSnippet(93, "The ecofill utility is recommended for adjusting fill adjacent to small ECO changes on metal layers. ");
MGCAddSnippet(94, "Modifies existing generated fill based on design ECO changes.");
MGCAddSnippet(95, "Calibre YieldEnhancer PowerVia is a flow with a utility (powervia) that is specifically designed to provide you with an automated solution for inserting additional vias to help improve the yield and reliability of your designs.");
MGCAddSnippet(96, "This automated flow uses the powervia utility to insert additional vias to reduce IR drop and EM issues in a design.");
MGCAddSnippet(97, "The powervia utility is invoked from the command line along with the required environment settings.");
MGCAddSnippet(98, "You can use certain specifications in the Calibre YieldEnhancer PowerVia flow to apply constraints, such as setting the lower layers in the via stack, defining the via‑to‑via spacing checks, and controlling the via counts in arrays.");
MGCAddSnippet(99, "The layer definitions for the via stack are controlled through Tcl procedures and via variable specifications based on the foundry process used for the Calibre Yield Enhancer PowerVia flow.");
MGCAddSnippet(100, "The lower starting layers for the Calibre YieldEnhancer PowerVia flow can be set by Tcl procedures in the techlib.tcl file and via parameters in the via variables files.");
MGCAddSnippet(101, "When lower layer via specifications are used for foundry processes that use the generated via variables file, the via type information must be explicitly defined for these lower layers.");
MGCAddSnippet(102, "The via addition process can be controlled by a variable and parameters defined in the techlib.tcl file.");
MGCAddSnippet(103, "The Calibre YieldEnhancer PowerVia flow has the capability to insert different via types such as  LRG ,  BAR , and  SQUARE  within a single run.");
MGCAddSnippet(104, "The spacing checks between vias on neighboring (upper and lower) via layers in the Calibre YieldEnhancer PowerVia flow can be controlled by adding Tcl procedures to the techlib.tcl file and space constraints to the via variables files.");
MGCAddSnippet(105, "The Calibre YieldEnhancer PowerVia flow uses certain variable specifications to perform connectivity‑based spacing from upper‑via layers to lower‑via layers (Vx to Vx-1).");
MGCAddSnippet(106, "The spacing checks between bar (BAR) vias, whether existing in the design or inserted by the Calibre YieldEnhancer PowerVia flow, can be controlled by adding additional space constraints to the via variables files.");
MGCAddSnippet(107, "The Calibre YieldEnhancer PowerVia flow has functionality that controls spacing between vias (original and fill vias) located on the same layers. This functionality is available for all supported technology flows.");
MGCAddSnippet(108, "The Calibre YieldEnhancer PowerVia flow uses certain variable specifications to enable connectivity‑based spacing for same‑layer vias on the same nets and on different nets.");
MGCAddSnippet(109, "Spacing by parallel run length (PRL) is used in the Calibre YieldEnhancer PowerVia flow to control spacing for same‑layer vias on the same nets and different nets. The PRL spacing is based on the projection (edge‑length extension) of one via on another. ");
MGCAddSnippet(110, "The definitions of exclusion areas for input layers are used by all foundry processes and are controlled in the Calibre YieldEnhancer PowerVia flow by adding a mandatory Tcl procedure to the techlib.tcl file.");
MGCAddSnippet(111, "In certain technology flows, DRC rules are used to create filters for the vias that are inserted into the design. You can use the post‑filtering ability of the Calibre YieldEnhancer PowerVia flow to apply rule constraint options to check the minimum via count in a via array.");
MGCAddSnippet(112, "For technology flows that use the generated via variables file, the Calibre YieldEnhancer PowerVia flow uses certain specifications and Tcl procedures to extract the original layers for extended via types (BAR1, BAR2,... LRG1, LRG2...).");
MGCAddSnippet(113, "The files and specifications used in the flow depend on your foundry process and may vary from the examples in this section. See your Siemens EDA representative for assistance with customizing your inputs for the Calibre YieldEnhancer PowerVia flow.");
MGCAddSnippet(114, "The via variables file is a text file that describes the via parameters.");
MGCAddSnippet(115, "The enclosure template file contains the via and metal width‑dependent enclosure constraints.");
MGCAddSnippet(116, "Certain foundry processes use an input file with via enclosure specifications to generate the via enclosure template file used for the Calibre YieldEnhancer PowerVia flow.");
MGCAddSnippet(117, "The Calibre YieldEnhancer PowerVia PERC flow requires an SVRF file containing Calibre PERC layer specifications.");
MGCAddSnippet(118, "The via backannotation flow provides the capability to output vias generated by the Calibre YieldEnhancer PowerVia flow in incremental Design Exchange Format (DEF). ");
MGCAddSnippet(119, "The Calibre YieldEnhancer PowerVia flow uses an internal case‑sensitive mode for proper handling of duplicate net name specifications.");
MGCAddSnippet(120, "The techlib.tcl file contains configuration information for running the Calibre YieldEnhancer PowerVia flow.");
MGCAddSnippet(121, "The powervia utility along with certain commands, variables, and specifications are used for running the Calibre YieldEnhancer PowerVia flow.");
MGCAddSnippet(122, "Adds additional vias to specified nets in a design and outputs an updated via database in GDSII or OASIS format.");
MGCAddSnippet(123, "The powervia utility uses certain variable specifications for running the Calibre YieldEnhancer PowerVia flow");
MGCAddSnippet(124, " Certain DFM-specific terms and concepts are defined and described.");
MGCAddSnippet(125, "Binning refers to organizing statistically similar results into classes. ");
MGCAddSnippet(126, "Binning random particles refers to defining ranges of particle sizes that are likely to be encountered during the manufacturing process, and specifying for each bin the probability that defects in that size range are encountered. ");
MGCAddSnippet(127, "The procedure for binning recommended rule violations includes assigning cost factors to ranges of rule conditions, then using those costs as a weight for calculating yield or quality metrics. ");
MGCAddSnippet(128, "The Calibre nmDRC hierarchical engine saves results and status information from each run.");
MGCAddSnippet(129, "The Calibre nmDRC results summary is a text file that the Calibre nmDRC hierarchical engine generates during a run. ");
MGCAddSnippet(130, "The Calibre transcript is a text transcript that the Calibre nmDRC hierarchical engine automatically generates at run-time and sends to stdout, which is typically the shell window from which you invoked the application. ");
MGCAddSnippet(131, "When running a Critical Area Analysis (CAA) session, notification messages for DDKs may be written to the Calibre transcript. ");
MGCAddSnippet(132, "The capture window is a portion of a layout database evaluated or reported on by one of the DFM operations.");
MGCAddSnippet(133, "Clustering refers to organizing geometric data from multiple layers according to proximity. Clustering is used by the DFM RDB and by DFM Property operations. With DFM Property you can also cluster objects based on node number rather than spatial relationship. ");
MGCAddSnippet(134, "Concurrency refers to running multiple layer operations simultaneously, thereby reducing processing time. ");
MGCAddSnippet(135, "Critical Area is the portion of a layout that comprises the locus of defect center points that can cause opens or shorts in the circuit. ");
MGCAddSnippet(136, "The critical area for shorts is the portion of the design where a short will occur if the center point of a contaminate lands there.");
MGCAddSnippet(137, "The critical area for opens is the portion of the design where current will be disrupted if the center point of a contaminate lands there. ");
MGCAddSnippet(138, "The defect density is the probability that a random particle of a specific size will be present for a given manufacturing process. ");
MGCAddSnippet(139, "Derived error layers are layers containing clusters of one, two, three, or four edges from either one or two layers. ");
MGCAddSnippet(140, "Here is an example of a derived error layer.");
MGCAddSnippet(141, "Annotations are data in the form of name and value pairs that you associate with data in a DFM database. ");
MGCAddSnippet(142, "Both RDB and DFM databases allow users to attach metadata to some types of objects. ");
MGCAddSnippet(143, "A DFM database is created by the DFM Database specification statement. It is generated in a calibre -dfm run. The format is proprietary.");
MGCAddSnippet(144, "DFM Expressions are expressions used to define the DFM-related properties, scores, and statistics that describe and report on layout data. They are used in DFM Analyze, the DFM Property family of operations, DFM Spec Fill Optimizer, and DFM Function. ");
MGCAddSnippet(145, "You can create user-defined DFM functions with the DFM Function statement. The user‑defined functions can be used within DFM expressions in DFM Property, DFM Analyze, and other DFM Function statements. User-defined functions make it easier to code complicated expressions and reuse them. ");
MGCAddSnippet(146, "DFM properties are a form of metadata associated with layout objects such as polygons, edges, and errors. They are typically numerical values used for calculating scores and filtering data. Each property has a name and a value. Property names are case-sensitive.");
MGCAddSnippet(147, "You can use certain math operators in DFM Expressions to create DFM functions.");
MGCAddSnippet(148, "Binary operators take two numeric arguments as inputs and produce a numeric output value. ");
MGCAddSnippet(149, "Unary operators take one numeric argument. ");
MGCAddSnippet(150, "Partitioning refers to dividing geometric data into meaningful and manageable chunks.");
MGCAddSnippet(151, "Partitioning by WINDOW refers to breaking design data into rectangular areas, or capture windows, of a specified size. ");
MGCAddSnippet(152, "You can specify the capture window size through the arguments to the WINDOW keyword. ");
MGCAddSnippet(153, "You control the step size by which to iteratively move the capture window through the data using the arguments to the STEP keyword, which you can only use with WINDOW. ");
MGCAddSnippet(154, "For the DFM Analyze operations, you have the option to control the capture window size by defining the number of windows into which the area under investigation is to be divided.");
MGCAddSnippet(155, "You specify the boundary of the design data to be evaluated using the INSIDE OF keyword, which you can only use with WINDOW. ");
MGCAddSnippet(156, "Partitioning by cell refers to chunking design data on a per-cell basis. ");
MGCAddSnippet(157, "Pattern substitution refers to a string processing feature that replaces a predefined string with a predictable value.");
MGCAddSnippet(158, "Quality assessment metrics are metrics that provide a relative grading of designs with respect to the factors that you define to be important. ");
MGCAddSnippet(159, "A results database is a database containing data that results from processing original or derived layers with one or more Calibre nmDRC or DFM operations. ");
MGCAddSnippet(160, "When running calibre -drc, the default behavior is to write all rule check results to the DRC Results Database file. ");
MGCAddSnippet(161, "A DFM RDB file is a results database that you create in addition to the DRC Results Database when using DFM layer operations in a calibre -drc run. If used in a calibre -dfm run, DFM RDB output data is stored in a DFM Database on a per-layer rather than per-check basis. Additionally, certain layer operations support an RDB keyword. This keyword generates a results database similar to the DFM RDB operation.");
MGCAddSnippet(162, "A runset is a text file created by Calibre Interactive DFM to store the settings you specify in the GUI. It is a record of the data displayed in the user interface at the time the runset was created.");
MGCAddSnippet(163, "A vector is a two-dimensional array of numbers in which one dimension, the tuple size, is fixed and the other dimension, the number of tuples, is variable. ");
MGCAddSnippet(164, "Yield assessment metrics are metrics that predict actual yield for specific designs. ");
MGCAddSnippet(165, "Calibre YieldServer is a software system designed specifically for managing the layout design data required when designing for improved manufacturability and yield.");
MGCAddSnippet(166, "This section includes DFM reference material, including certain application statements and file format specifications.");
MGCAddSnippet(167, "The reference information for the Calibre DFM Via Shift commands is provided. These commands use a Calibre YieldEnhancer license.");
MGCAddSnippet(168, "The DFM Via Shift and DFM Spec Via Shift SVRF commands are used together with Calibre YieldEnhancer after RET metal biasing and retargeting to improve via locations and metal coverage while observing mask rule check (MRC) constraints.");
MGCAddSnippet(169, "Specifies MRC constraints to improve via location and metal coverage, preventing MRC violations. Referenced by DFM Via Shift. Uses a Calibre YieldEnhancer license.");
MGCAddSnippet(170, "Improves via location and metal coverage without introducing MRC violations. Requires DFM Spec Via Shift for MRC constraint specification. Uses a Calibre YieldEnhancer license.");
MGCAddSnippet(171, "The reference information for the Calibre DFM Reshape commands is provided. These commands use a Calibre YieldEnhancer license. ");
MGCAddSnippet(172, "Specifies a set of correction values that are used to transform corner and line‑end metal shapes for improved via enclosure. Referenced by DFM Reshape. Uses a Calibre YieldEnhancer license.");
MGCAddSnippet(173, "Performs geometric shape transformations on the input layer to imitate actual metal shapes for subsequent via operations. Requires DFM Spec Reshape for constraint specifications. Uses a Calibre YieldEnhancer license.");
MGCAddSnippet(174, "The Calibre YieldAnalyzer and Calibre YieldEnhancer toolsets use proprietary DFM Results Databases (RDBs) to store the types of data required for analysis and enhancement. ");
MGCAddSnippet(175, "Contains scores or statistics generated by DFM Analyze. ");
MGCAddSnippet(176, "Contains an ASCII representation of the geometric results from a DFM Measure operation and statistics about the results. ");
MGCAddSnippet(177, "Contains an ASCII representation of transition geometries and statistics. The transition geometries are on one via layer and two interconnect layers.  There is one rule check for each capture window or cell. Each rule check reports statistics regarding the total number of transitions that intersect the window or cell—these statistics are reported as check text. A rule check also includes one result for each transition geometry that was created. All geometric results and statistics are reported as if the operation were executed completely flat.");
MGCAddSnippet(178, "Contains an ASCII representation of one original or derived layer. ");
MGCAddSnippet(179, "Contains an ASCII representation of multiple original or derived layers. Shapes on the input layers are organized into clusters. A cluster is composed of one shape from the first input layer (the primary layer) in the DFM RDB operation plus all shapes from the additional input layers (the secondary layers) that overlap the primary layer shape.");
MGCAddSnippet(180, "Contains statistics generated by a DFM Fill operation. The Fill RDB is specified in the DFM Spec Fill statement with the RDB keyword. ");
MGCAddSnippet(181, "DFM operations use various file formats.");
MGCAddSnippet(182, "This section describes the histogram file. ");
MGCAddSnippet(183, "Two or more lines.");
MGCAddSnippet(184, "Two lines of histogram summary followed by one line per histogram bin.");
MGCAddSnippet(185, "The CAA defect data contains a set of particle sizes and density lists for a particular process. ");
MGCAddSnippet(186, "The format of the defect data file is one entry per line that provides the defect layer name and type, range of defect sizes, and defect density specification.");
MGCAddSnippet(187, "Modeling defect types requires certain layer and defect parameter specifications. The CAA defect file contains one set of data per line that is used to specify the defect model type, the layer information, and the defect parameters. ");
MGCAddSnippet(188, "Some layer names in the file may also be predefined. ");
MGCAddSnippet(189, "A CAA layers file is an ASCII file defining the layers to be used for critical area analysis.");
MGCAddSnippet(190, "There are two parts to a CAA layers file: layer definitions and layer name map.");
MGCAddSnippet(191, "A custom name can be specified for the OD layer in the CAA layers file. If a custom name is specified, then this name is used as the rule name in Calibre RVE for DFM.");
MGCAddSnippet(192, "If your design contains embedded SRAMs with repair resources consisting of redundant rows or columns, you need to prepare a memory configuration file (memconfig.txt) that specifies the available repair resources. ");
MGCAddSnippet(193, "The Critical Area Analysis library flow allows you to run the analysis on a 1x1, 1x3 or 3x3 grid for each standard cell. ");
MGCAddSnippet(194, "The What-if analysis tool has a specific configuration file format.");
MGCAddSnippet(195, "A Fill layermap file is an ASCII file defining the mapping between the fill layers in a DFM database and the backannotation layers in the original layout. ");
MGCAddSnippet(196, "There are two parts to a Fill layermap file: comment text and layer name map.");
MGCAddSnippet(197, "The table provides a summary of the CAA-specific reference topics.");
MGCAddSnippet(198, "The CAA tool can generate a critical area analysis rule file, generate a defect data file, and run a set of critical area analyses using different defect data.");
MGCAddSnippet(199, "At the command prompt, enter the command to launch Calibre Interactive DFM.");
MGCAddSnippet(200, "A tutorial and example kit (eKit) is available to you that demonstrates using the CAA tool.");
MGCAddSnippet(201, "Use this tool to review scores and errors generated by a critical area or recommended rule analysis.");
MGCAddSnippet(202, "Follow the steps to access the DFM Report Card.");
MGCAddSnippet(203, "This section describes the Calibre RVE for DFM report card interface that you see when you load a DFM database.");
MGCAddSnippet(204, "The Calibre RVE for DFM report card is an interface that displays DFM check and score data in a tabular format. ");
MGCAddSnippet(205, "You can sort by flat metrics from the Cell Summary tab.");
MGCAddSnippet(206, "The following sections describe the tab contents. ");
MGCAddSnippet(207, "This tab shows all rules with the  DFM_TYPE  annotation set to  total . ");
MGCAddSnippet(208, "Use this tab to view score data for the full chip. ");
MGCAddSnippet(209, "Use this tab to view score data by cell.");
MGCAddSnippet(210, "Use this tab to view score data by window.");
MGCAddSnippet(211, "Use this tab to view score data associated with a particular cell or window.");
MGCAddSnippet(212, "Use this tab to examine errors on a layer-by-layer basis or examine a specific area on the selected layer.");
MGCAddSnippet(213, "You can highlight errors on a specific layer using Calibre RVE for DFM.");
MGCAddSnippet(214, "You can use Calibre RVE for DFM to recreate and highlight unsaved derived layers.");
MGCAddSnippet(215, "Layer drill down is a useful method to locate problems on a layer.");
MGCAddSnippet(216, "Color map display options provide a method to visualize the DFM results.");
MGCAddSnippet(217, "From the View menu, select MetricsSelect Multiple. ");
MGCAddSnippet(218, "You can generate histograms of result counts versus scores to identify areas in your design most likely to affect yield.");
MGCAddSnippet(219, "From the Chip Summary tab, right click on a rule and select Histogram Hierarchy CellsDFM_SCORE: Combined. ");
MGCAddSnippet(220, "You can change the global color gradient used in histograms in colormaps through the SetupOptionsHistograms menu. ");
MGCAddSnippet(221, "Mentor standard layer names are layer names that the Calibre Critical Area Analysis tool recognizes. ");
MGCAddSnippet(222, "The Calibre RVE for DFM user interfaces are designed to display DFM check and scores data in a report card format. ");
MGCAddSnippet(223, "This section describes DFM Report Card controls. ");
MGCAddSnippet(224, "Layer annotations are used to report specific information in the DFM Report Card.");
MGCAddSnippet(225, "There are several database-level annotations that you can add to your rule file to enhance design analysis.");
MGCAddSnippet(226, "The DFM Report Card annotations can be implemented in a rule file.");
MGCAddSnippet(227, "Certified Calibre DFM functionality for each of the various foundry flows is described. ");
MGCAddSnippet(228, "UMC has certified Calibre tools for performing critical area analysis and yield enhancement.");
MGCAddSnippet(229, "The Calibre YieldAnalyzer Critical Area Analysis (CAA) functionality is fully certified in the UMC flow. ");
MGCAddSnippet(230, "You can run Calibre YieldEnhancer with a UMC rule file.");
MGCAddSnippet(231, "The Common Platform Alliance has developed rule files for performing critical area analysis and critical feature analysis. These rule files are available to their customers in encrypted form.");
MGCAddSnippet(232, "You can run CAA with a Common Platform Alliance rule file.");
MGCAddSnippet(233, "You can run CFA with a Common Platform Alliance rule file.");
MGCAddSnippet(234, "ST has developed has developed rule files for performing critical feature analysis and yield enhancement. These rule files are available to their customers.");
MGCAddSnippet(235, "You can run CFA with an ST rule file.");
MGCAddSnippet(236, "You can run Calibre YieldEnhancer with an ST rule file.");
MGCAddSnippet(237, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

